import React,{useEffect, useState} from "react";
import Tuscany from '../DB/Tuscany.json';
import DatePicker from "react-datepicker";

// import grp from '../assets/home/icons/grp.png';
import drtn from '../assets/home/icons/icons_tours/duration.svg'
import lctn from '../assets/home/icons/location.svg';
import gd from '../assets/home/icons/icons_tours/guide.svg'
import ln from '../assets/home/icons/icons_tours/language.svg'
import fs from '../assets/home/icons/icons_tours/ticket.svg'
// import trnsprt from '../assets/home/icons/icons_tours/transport.svg'



export default function SpecificTour () {
    const [startDate, setStartDate] = useState(new Date());
    const [images, setImages] = useState([]);
    const [tours,setTours] = useState([]);
// useEffect(()=> {
//     fetch('http://tourstotuscany/tours')
//     .then(response=>response.json())
//     .then (data=>setTours(data))
//     .catch(error => console.error(error));
// },[])
    return(
        <section>
            <section className="Gallery">
        {Tuscany.map((Tuscany,index)=> (
            <section>
                <section key={Tuscany.id}>
                    <h3> {Tuscany.title}</h3>
                    <section className="price">
                        <p>from <p>{Tuscany.price}</p></p>
                </section>
                <p>{Tuscany.short_description}</p>
                <lable>Date</lable>
                <section className="date-picker">
                    <DatePicker
                        selected={startDate}
                        onChange={(date) => setStartDate(date)}
                        dateFormat="dd/MM/yyyy"
                        placeholder="Select the date" />
                </section>
            </section>
                <lable>Time</lable>
            <section>
                    <DatePicker
                        selected={Date}
                        onChange={(date) => setStartDate(date)}
                        showTimeSelect
                        showTimeSelectOnly
                        timeIntervals={15}
                        timeCaption="Time"
                        dateFormat="h:mm aa"
                        placeholder="Select the time" 
                    />
                </section>
                <button> Buy Now</button>
                <section>
                    <h3>Details</h3>
                    <p>{Tuscany.details}</p>
                    <section>
                        {/* <img src={grp} alt="numberOfPeople" /> <p> Number of group:{Tuscany.people}</p> */}
                    </section>
                    <section>
                        <img src={drtn} alt="Duration of tour"/> <p> Duration:{Tuscany.duration}</p>
                    </section>
                    <section>
                        <img src={lctn} alt="Departurting from"/> <p> Departuring and arriving areas:{Tuscany.departure}</p>
                    </section>
                    <section>
                        <img src={gd} alt="Guide"/> <p> Guide service:{Tuscany.service}</p>
                    </section>
                    <section>
                        <img src={ln}  alt="Language"/> <p> Language:{Tuscany.language}</p>
                    </section>
                    <section>
                        <img src={fs} alt="Fees" /> <p> Entry Fees:{Tuscany.fees}</p>
                    </section>
                    <section>
                        {/* <img src={trnsprt} alt="Transport" /><p> Entry Transportation:{Tuscany.transport}</p> */}
                    </section>
                </section>
                </section>
        ))}
              </section>  
              <section className="Gallery">
               
              </section>
        </section>
    )
}
